import React from "react";
import "./App.css";
import Card from './Componentes/Card'
import Primera from './Componentes/primera.jpg'


function App() {
  const imagenes = [
    {
      img: Primera,
      title: "LUNES",
      subtitle: "Powerful Women",
      color: "#FF0606",
      texto:
        " ksaldsk"
    }
  ];
  return (
    <div>
      {imagenes.map(card => {
        return (
          <Card
            title={card.title}
            color={card.color}
            img={card.img}
            subtitle={card.subtitle}
            texto={card.texto}
          ></Card>
        ); 
      })}
    </div>
  );
}

export default App;
